import React, { useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import axios from 'axios';
import { toast } from 'react-toastify';
import Nav from '../../components/Nav';
import { removeAuthUser } from '../../redux/userSlice';

const Profile = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const { authUser } = useSelector((state) => state.user);

  useEffect(() => {
    if (!authUser) {
      navigate('/login');
    }
  }, [authUser, navigate]);

  if (!authUser) return null;

  const {
    id,
    name,
    email,
    rating,
    rank,
    totalGames,
    wins,
    solutionsSubmitted,
    joinDate,
    lastActive,
    achievements = [],
  } = authUser;

  const winPercentage = totalGames ? Math.round((wins / totalGames) * 100) : 0;

  const handleLogout = async () => {
    try {
      const res = await axios.get('http://localhost:8080/api/users/logout');
      toast.success(res.data.message);
      dispatch(removeAuthUser());
      navigate('/');
    } catch (error) {
      toast.error(error.response?.data?.message || 'Logout failed. Please try again.');
    }
  };

  return (
    <div className="min-h-screen bg-dark relative overflow-hidden flex flex-col">
      <div className="absolute inset-0 bg-gradient-radial from-primary/30 via-secondary/20 to-dark" />
      <Nav />

      <div className="relative z-10 flex-grow container mx-auto px-4 py-8">
        <div className="h-full flex flex-col">
          <div className="flex-grow">
            <div className="max-w-7xl mx-auto h-full">
              <div className="h-full flex flex-col md:flex-row gap-8">
                {/* Profile Card */}
                <div className="w-full md:w-1/3 h-full">
                  <div className="h-full bg-gray-800 rounded-xl p-6 shadow-lg border border-gray-700 flex flex-col transition-transform duration-300 hover:scale-[1.01]">
                    <div className="flex flex-col items-center flex-grow">
                      <div className="w-32 h-32 rounded-full bg-primary/20 flex items-center justify-center border-4 border-primary/50 mb-4">
                        <span className="text-5xl font-bold text-primary">
                          {name.charAt(0).toUpperCase()}
                        </span>
                      </div>

                      <h2 className="text-2xl font-bold text-white">{name}</h2>
                      <p className="text-gray-400">@{id}</p>
                      <p className="text-gray-400 text-sm mt-1">{email}</p>

                      <div className="mt-6 w-full">
                        <div className="flex justify-between text-sm text-gray-400 mb-1">
                          <span>Rating</span>
                          <span className="text-white font-bold">{rating}</span>
                        </div>
                        <div className="h-2 bg-gray-700 rounded-full overflow-hidden">
                          <div
                            className="h-full bg-gradient-to-r from-blue-500 to-purple-600"
                            style={{ width: `${(rating / 3000) * 100}%` }}
                          ></div>
                        </div>
                      </div>

                      <div className="mt-6 grid grid-cols-2 gap-4 w-full">
                        <StatCard label="RANK" value={rank} color="text-primary" />
                        <StatCard label="WIN RATE" value={`${winPercentage}%`} color="text-green-500" />
                      </div>

                      <div className="mt-6 w-full flex-grow">
                        <h4 className="text-lg font-bold text-white mb-3">Details</h4>
                        <div className="space-y-2">
                          <DetailRow label="Member Since" value={new Date(joinDate).toLocaleDateString()} />
                          <DetailRow label="Last Active" value={new Date(lastActive).toLocaleDateString()} />
                        </div>
                      </div>
                    </div>
                  </div>
                </div>

                {/* Stats Section */}
                <div className="w-full md:w-2/3 h-full">
                  <div className="h-full bg-gray-800 rounded-xl p-6 shadow-lg border border-gray-700 flex flex-col">
                    <h3 className="text-xl font-bold text-white mb-6">Player Statistics</h3>

                    <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                      <StatCard title="Total Games Played" value={totalGames} icon="ðŸŽ®" color="text-blue-400" />
                      <StatCard title="Games Won" value={wins} icon="ðŸ†" color="text-green-400" />
                      <StatCard title="Solutions Submitted" value={solutionsSubmitted} icon="âœ" color="text-yellow-400" />
                      <StatCard title="Win Percentage" value={`${winPercentage}%`} icon="ðŸ“Š" color="text-purple-400" />
                    </div>

                    <div className="mt-8">
                      <h4 className="text-lg font-bold text-white mb-4">Achievements</h4>
                      <div className="flex flex-wrap gap-2">
                        {achievements.map((achievement, index) => (
                          <span
                            key={index}
                            className="inline-flex items-center px-3 py-1 rounded-full text-xs font-medium bg-gray-700 text-gray-200"
                          >
                            {achievement}
                          </span>
                        ))}
                      </div>
                    </div>

                    <div className="mt-8 flex-grow">
                      <h4 className="text-lg font-bold text-white mb-4">Recent Activity</h4>
                      <div className="space-y-3">
